import React, { Component } from "react";
import { FaReact } from "react-icons/fa";

const devCardIcon = props => {
  return (
    <div className="card text-center">
      <div className="overflow">
        <FaReact />
      </div>
    </div>
  );
};

export default devCardIcon;
